import axios from "axios";

const URL = 'http://localhost:2510/expenses';

const setExpense = (amount, category, date) => {
    return axios.post(URL, { amount, category, date });
  };

  const getExpenses = () => {
    return axios.get(URL);
  };



  
export default{
    setExpense,
    getExpenses
}
